import React from "react";
import { Card } from "../../UI/Card.styled";
import Headlines from "../../UI/Headlines";
import CommentItem from "./CommentItem";

const SectionFive = ({ content, styles, UI }) => {
  const HeadlineProps = {
    height: "4rem",
    h1: {
      fontsize: "1.5rem",
      text: "What",
      color: "#5A5A5A",
    },
    h2: {
      fontsize: "2rem",
      text: "Our Users Say",
      color: "black",
    },
    icons: [UI.NextArrow, UI.PreviousArrow],
  };

  const usersComments = [
    {
      id: 0,
      togggle: false,
      picture: UI.JediPicture,
      user: "@ Drew Jedi",
      comment:
        "Best NFTS Collectibles Ever, and also give out best rates for the rarest collectibles in the marketplaces.",
    },
    {
      id: 1,
      togggle: false,
      picture: UI.picture44,
      user: "@ 44_Two",
      comment:
        "Best NFTS Collectibles Ever, and also give out best rates for the rarest collectibles in the marketplaces.",
    },
    {
      id: 3,
      togggle: false,
      picture: UI.YellowGirlPicture,
      user: "@ Dhat Yellow_Girl",
      comment:
        "Best NFTS Collectibles Ever, and also give out best rates for the rarest collectibles in the marketplaces.",
    },
  ];
  const renderedContents = usersComments.map((element, index) => {
    return <CommentItem />;
  });
  return (
    <Card mg={"0rem 2rem"} bd={"1px solid red"} height={"15rem"}>
      <Headlines HeadlineProps={HeadlineProps} />
      <Card
        mg={"1rem 0rem"}
        width={"100%"}
        dp={"grid"}
        gridC={"30% 30% 30%"}
        gridjc={"space-around"}
        height={"9rem"}
        bd={"1px solid red"}
      >
        {renderedContents}
      </Card>
    </Card>
  );
};

export default SectionFive;
